  always @ (*) begin
    if (INJECTDBITERR_int || INJECTSBITERR_int) begin
      if (((CASCADE_ORDER_B_BIN == CASCADE_ORDER_B_LAST) ||
           (CASCADE_ORDER_B_BIN == CASCADE_ORDER_B_MIDDLE)) && CASDIMUXB_in)
         mem_wr_b = {CASDINB_in, CASDINA_in} ^ {bit_err_pat, 28'h0};
