`timescale 1 ps / 1 ps

`celldefine

module DSP_C_DATA #(
`ifdef XIL_TIMING
  parameter LOC = "UNPLACED",
`endif
  parameter integer CREG = 1,
  parameter [0:0] IS_CLK_INVERTED = 1'b0,
  parameter [0:0] IS_RSTC_INVERTED = 1'b0
)(
  output [47:0] C_DATA,

  input [47:0] C,
  input CEC,
  input CLK,
  input RSTC
);
  
// define constants
  localparam MODULE_NAME = "DSP_C_DATA";

  reg trig_attr;
// include dynamic registers - XILINX test only
`ifdef XIL_DR
  `include "DSP_C_DATA_dr.v"
`else
  localparam [31:0] CREG_REG = CREG;
  localparam [0:0] IS_CLK_INVERTED_REG = IS_CLK_INVERTED;
  localparam [0:0] IS_RSTC_INVERTED_REG = IS_RSTC_INVERTED;
`endif

`ifdef XIL_XECLIB
  wire CREG_BIN;
`else
  reg CREG_BIN;
`endif

  reg attr_test;
  reg attr_err;
  tri0 glblGSR = glbl.GSR;

  wire CEC_in;
  wire CLK_in;
  wire RSTC_in;
  wire [47:0] C_in;

`ifdef XIL_TIMING
  wire CEC_delay;
  wire CLK_delay;
  wire RSTC_delay;
  wire [47:0] C_delay;
`endif
  
`ifdef XIL_TIMING
  assign CEC_in = (CEC !== 1'bz) && CEC_delay; // rv 0
  assign CLK_in = (CLK !== 1'bz) && (CLK_delay ^ IS_CLK_INVERTED_REG); // rv 0
  assign C_in[0] = (C[0] === 1'bz) || C_delay[0]; // rv 1
  assign C_in[10] = (C[10] === 1'bz) || C_delay[10]; // rv 1
