    $setuphold (negedge CLK, negedge CEM, 0:0:0, 0:0:0, notifier, clk_en_n, clk_en_n, CLK_delay, CEM_delay);
    $setuphold (negedge CLK, negedge OPMODE, 0:0:0, 0:0:0, notifier, clk_en_n, clk_en_n, CLK_delay, OPMODE_delay);
